import { gql } from "@apollo/client";
export const GET_USER_LOGIN = gql`
    query getUserByLogin(
            $username: String
            $password: String
        ) {
            getUserByLogin(
                username: $username
                password: $password
            ) {
                id
                username
                lastName
                firstName
                created
                email
                isActive
            }
        }   
`;
export const GET_ALL_USERS = gql`
    query getAllUsers {
        id
        firstName
        lastName
        email
        username
        active
        created
    }
`;
